drop table if exists gestalt_frontend_country_data; 
CREATE TABLE gestalt_frontend_country_data
(
  id integer,
  date_inserted date DEFAULT ('now'::text)::date,
  source_name text NOT NULL,
  source_id integer NOT NULL,
  series_id integer,
  country_id integer,
  date date,
  date_precision character varying(5),
  value numeric
);
